objetoCompra:
Contrato de manutenção preventiva e corretiva para Analisador Genético 3.500, Termociclador Veriti e Quant Studio 5, om um prazo de vigência da contratação de 01 (um) ano, contado da assinatura contratual, prorrogável por até 10 anos, na forma dos artigos 106 e 107 da Lei n° 14.133, de 2021. com cobertura dos seguintes serviços:

Manutenções corretivas ilimitadas;

Uma manutenção preventiva anual;

Incluir todas as peças necessárias para as manutenções corretivas;

Todos os consumíveis do checklist da Manutenção Preventiva;

Prioridade no tempo de resposta do time de suporte;

Todas as despesas de viagem e horas técnicas inclusas.

informacaoComplementar:
Contratação de empresa para prestação de serviços especializados de Assessoria e Consultoria em soluções contábeis para a administração pública, ao Município de Mucajaí - RR, por Execução Indireta, do tipo “MENOR PREÇO” MENSAL, conforme especificações e condições a seguir estabelecidas.
Realização dos serviços de contabilidade pública, conforme especificado abaixo:
?	Classificação da Contabilidade de acordo com as normas e princípios vigentes;
?	Lançamentos contábeis por processamento de dados de acordo com a Lei 4.320/64;
?	Emissão de balancetes contábeis mensais;
?	Elaboração de Prestação de Contas Anual, contendo os Anexos da 4.320/64 e demais documentos exigidos pelo TCE/RR;
?	Incorporação dos bens de Ativo Imobilizado através de lançamentos contábeis;
?	Efetuar Conciliação Bancária das contas existentes;
?	Emissão e encadernação do livro Razão Analítico;
?	Emissão, encadernação do livro diário;
?	Elaboração de relatórios de gestão fiscal, de acordo com a Lei de Responsabilidade Fiscal e Instruções normativas do TCE/RR;
?	Emissão de nota de empenho, liquidação e pagamento;
?	Acompanhamento do CAUC;
?	Emissão de relatórios gerenciais;
?	Transmissão do RGF do SINCONFI.
